                    "meta": "3,nöro,11,67",
                    "Q": "67 Panik Atakla ilgili yanlış olan ifade hangisidir?",
                    "A": "Panik Atak, yoğun bir korku ya da rahatsızlık duyma dönemidir.",
                    "B": "Panik Atak, Anksiyete Bozuklukları içinde ele alınan bir hastalık tanısıdır.",
                    "C": "Panik Atak sırasında çarpıntı, terleme, nefes darlığı, ölüm korkusu gibisemptomlardan en az dördü bulunmalıdır.",
                    "D": "Panik Atak, beklenmedik tarzda (dış uyaranlarla ilişkisiz) ya da dış uyaranlarabağlı olarak ortaya çıkabilir.",
                    "E": "Panik Atakta semptomlar en geç on dakika içinde en yüksek şiddetine ulaşır.",
                    "N": "B"
                },
                "68": {
                    "meta": "3,nöro,11,68",
                    "Q": "68 Panik Bozukluğu ile ilgili yanlış olan ifade hangisidir?",
                    "A": "Panik Bozukluğu tanısı koyabilmek için ataklardan en az birinden sonra en azbir ay süreyle ya atağın yineleyeceğine ilişkin kaygının, ya atak sırasındaolacağından korkulan durumla ilgili kaygının sürmesi, ya da belirgin davranışdeğişikliği olması gereklidir.",
                    "B": "Agorafobinin varlığında tanı “Agorafobili Panik Bozukluk”tur.",
                    "C": "Panik Bozukluk tanısı koymak için hastanın birden fazla panik atak geçirmesigereklidir.",
                    "D": "Kokain intoksikasyonuna bağlı olarak Panik Bozukluk gelişebilir.",
                    "E": "Başka bir mental bozukluğa bağlı olarak ortaya çıkan panik atakları nedeniyle",
                    "N": "D"
                },
                "69": {
                    "meta": "3,nöro,11,69",
                    "Q": "69 Özgül Fobiyle ilgili yanlış ifade hangisidir?",
                    "A": "Özgül Fobide, kişi fobik nesneyle ne zaman karşılaşırsa karşılaşsın anksiyete yaşar.",
                    "B": "Özgül Fobide, sadece fobik nesnenin varlığı değil, onun beklentisi deanksiyeteye neden olur.",
                    "C": "Özgül Fobisi olan hasta, korkusunun aşırı ya da anlamsız olduğunu bilir.",
                    "D": "Özgül Fobi tanısı koyabilmek için kişinin normal rutininin ve işlevselliğinin bozulmuş olması gerekir.",
                    "E": "Kişi 18 yaşının altındaysa, Özgül Fobi tanısı koymak için bozukluğun süresi en az bir yıl olmalıdır.",
                    "N": "E"
                },
                "70": {
                    "meta": "3,nöro,11,70",
                    "Q": "70 Aşağıdaki ifadelerden yanlış olan hangisidir?",
                    "A": "Yaygın Anksiyete Bozukluğu tanısı koymak için süre koşulu yoktur.",
                    "B": "Yaygın Anksiyete Bozukluğunda kişinin birçok etkinlik ya da olayla ilgilikaygıları vardır.",
                    "C": "Yaygın Anksiyete Bozukluğunda kaygılara uyku bozukluğu, dikkat bozukluğu,kolay öfkelenme, yorgunluk, kas gerginliği ve huzursuzluk gibi belirtilerden enaz üçü eşlik eder.",
                    "D": "Kişinin evden dışarı yalnız çıkamaması, taşıt araçlarında rahat seyahatedememesi, kalabalık ortamlarda bulunamaması agorafobidir.",
                    "E": "Sosyal Fobisi olan kişi tanıdık insanların karşısında herhangi bir performans sergilemiyorsa anksiyete yaşamayabilir.",
                    "N": "A"
                },
                "71": {
                    "meta": "3,nöro,11,71",
                    "Q": "71  Obsesif Kompulsif Bozuklukla ilgili yanlış ifade hangisidir?",
                    "A": "Obsesif Kompulsif Bozuklukta kişi obsesyonlarının kendi zihninin ürünüolduğunu bilir.",
                    "B": "Obsesyonlar, kişiyi rahatsız eden düşünce ya da davranışlardır.",
                    "C": "Kompulsiyonların amacı sıkıntıdan kurtulmak ya da korkulan bir durumdankorunmaktır.",
                    "D": "En sık görülen obsesyonlar bulaşma ve kuşku obsesyonlarıdır.",
                    "E": "Kontrol etme ve yıkanma kompulsiyonları sıktır.",
                    "N": "B"
                },
                "72": {
                    "meta": "3,nöro,11,72",
                    "Q": "72 Stres Bozukluklarıyla ilgili yanlış ifade hangisidir?",
                    "A": "Akut Stres Bozukluğu, süresi en fazla üç ay olan, travma sonrası gelişen birbozukluktur.",
                    "B": "Post Travmatik Stres Bozukluğu, travmadan aylar-yıllar sonra da başlayabilir.",
                    "C": "Her iki Stres Bozukluğunda da travmatik olay sık sık yeniden yaşanır.",
                    "D": "Artmış uyarılmışlık semptomları, Stres Bozukluklarının ortaközelliklerindendir.",
                    "E": "Akut Stres Bozukluğunda, kişinin travma sırasında disosyatif semptomlar yaşaması gereklidir.",
                    "N": "A"
                },
